import React from 'react';
import MovieListItem from './MovieListItem'


const MovieList = (props) => {
  return (
    <div>
    {props.movies.forEach((movie) => (
      <MovieListItem title={movie.title} poster={movie.poster_path} />))}
    </div>
  )
}


export default MovieList;
